import styles from "./SvgContainer.module.css";
import React from "react";
import { useLayoutEffect, useRef } from "react";
import { gsap } from "gsap";

export const SvgContainer = ({ svgClick }) => {
  const svgClickHandler = () => {
    console.log("svgClicked");
    svgClick(true);
  };

  //gsap animations
  const comp = useRef();
  useLayoutEffect(() => {
    let ctx = gsap.context(() => {
      gsap.fromTo(
        "#base",
        {
          opacity: 0,
          x: -5000,
        },
        {
          x: 0,
          opacity: 1,
          duration: 1,
          delay: 1,
          ease: "elastic.out(0.8, 0.4)",
        }
      );
      gsap.fromTo(
        "#head",
        {
          y: -7000,
        },
        { y: 0, rotate: "360", duration: 1, delay: 0.5, ease: "power2.out" },
        "<"
      );
      gsap.fromTo(
        "#lemon",
        {
          opacity: 0,
        },
        { opacity: 1, duration: 1.5, delay: 1, ease: "power2.out" },
        "<"
      );
      gsap.fromTo(
        "#umbrella",
        {
          opacity: 0,
          x: 1000,
          y: -1000,
        },
        { x: 0, y: 0, opacity: 1, duration: 1.5, delay: 1, ease: "power2.out" },
        "<"
      );
    }, comp);
    return () => ctx.revert();
  }, []);

  return (
    <div
      ref={comp}
      className={styles["svg-container"]}
      onClick={svgClickHandler}
    >
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="160"
        height="188"
        viewBox="0 0 1602 1880"
        className={styles["head"]}
      >
        <image
          id="head"
          width="1602"
          height="1880"
          xlinkHref="data:img/png;base64,"
        />
      </svg>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="54"
        height="61"
        viewBox="0 0 545 612"
        className={styles["lemon"]}
      >
        <image
          id="lemon"
          width="545"
          height="612"
          xlinkHref="data:img/png;base64,"
        />
      </svg>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="73"
        height="69"
        viewBox="0 0 737 696"
        className={styles["umbrella"]}
      >
        <image
          id="umbrella"
          width="737"
          height="696"
          xlinkHref="data:img/png;base64,"
        />
      </svg>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        xmlnsXlink="http://www.w3.org/1999/xlink"
        width="871"
        height="732"
        viewBox="0 0 8710 7321"
        className={styles["base"]}
      >
        <image
          id="base"
          width="8755"
          height="7475"
          xlinkHref="data:img/png;base64,"
        />
      </svg>
    </div>
  );
};
